import React from 'react'


export default function Head() {
  return (
    <div style={{background: '#424242', height: '40px', fontSize: '12px'}}>
    <div style={{display:'flex', paddingLeft: '20%', paddingRight: '20%', justifyContent:'right'}}>            
        <button   style={{paddingRight: '5%', color: "white",border: 0, background: 'transparent', outline:'none', fontSize: 20}} >Программа интерактивного обучения поведению с агрессивными животными</button>

    </div>
    </div>
  )
}
